import Link from 'next/link'

export default function Btn(props, { primary, children }) {
  return (
    <>
      <Link href={props.link}>
        <a>
          <button
            className={`.btn ${primary && '.primary ' && props.className || props.className}`}
            onClick={props.onClick}
          >
            {children}
          </button>
        </a>
      </Link>
    </>
  )
}
